import React from 'react';
import App from '../src/components';
import { createGlobalStyle } from 'styled-components';

const GlobalStyle = createGlobalStyle`
body {
    margin: 0;
    padding: 0;
    width: 100%;
    height: 100%;
  }
  html {
    box-sizing: border-box;
    font-family: 'monserrat' sans serif;
  }
`;

const Home: React.FC = () => {
    return (
        <GlobalStyle>
            <App />
        </GlobalStyle>
    );
};

export default Home;
